create database library1;
use library1;
/*
1.区域表(区域名 , 楼层),
	其中区域分为自然科学综合图书书库, 工业技术专业书库, 法律经济专业书库, 社会科学综合书库, 文学艺术历史专业书库, 自然科学报刊,
	自然科学报刊阅览室, 社会科学报刊阅览室, 医学专业书库;
	
2.座位表(座位ID, 区域名, 类型)
	其中座位类型仅分为单人,双人与多人(学校中,每个座位都有插座,单人或者双人的座位都是靠窗的,多人座位都不靠窗);

3.用户名(用户ID, 用户姓名, 院系, 信誉分, 邮箱, 手机号, 密码)

4.占座表(用户ID, 座位ID, 预约时间)
	其中预约时间为座位为该用户所用的起始时间

5.检举表(用户ID,座位ID,检举类型,检举时间)
	其中检举类型为1:吵闹,2:吃东西,3:打游戏/睡觉;4:以物占座,座位无人;5:其他

6.喜好类型(用户ID, 类型, 喜好度)
	其中喜好度分为0-9;

*/
create table area(	
	areaname varchar(50),
	typename  varchar(10),
	floornumber numeric(2,0)
);

create table seat(	
	seatID numeric(4,0),
	areaname varchar(50),
	typename  varchar(10)
	);

create table users(	
	userID numeric(12,0),
	username varchar(20),
	deptname varchar(30),
	creditscore numeric(3,0),
	email varchar(20),
	phonenumber numeric(12,0),
	passwords varchar(20)
	);

create table seated(
	userID numeric(12,0),
	seatID numeric(4,0),
	bookingtime numeric(5,0),
                arrived numeric(3)
	);

create table report(
	userID numeric(12,0),
	seatID numeric(4,0),
	reporttime numeric(5,0),
	reporttype varchar(20)
	);

create table preference(
	userID numeric(12,0),
	typename  varchar(20),
                areaname varchar(30),
	degree numeric(1,0)
	);
create table user_area (
userID numeric(12,0),
areaname varchar(50),
typename  varchar(10)
);










update users set creditscore=userID%100 where true;



update seat set areaname='自然科学综合图书书库' where seatID>=1 and seatID<=200;
update seat set areaname='工业技术专业书库' where seatID>=201 and seatID<=400;
update seat set areaname='法律经济专业书库' where seatID>=401 and seatID<=600;
update seat set areaname='社会科学综合书库' where seatID>=601 and seatID<=800;
update seat set areaname='文学、艺术、历史专业书库' where seatID>=801 and seatID<=1000;
update seat set areaname='自然科学报刊阅览室' where seatID>=1001 and seatID<=1200;
update seat set areaname='社会科学报刊阅览室' where seatID>=1201 and seatID<=1400;
update seat set areaname='医学专业书库' where seatID>=1401 and seatID<=1600;
